/**
 * @function TreeIcon
 * @description Renders the high-fidelity, vector-based glyph representing ecological growth and sustainability commitment.
 * This icon is dynamically styled based on the current data integrity score.
 * @returns {JSX.Element} The SVG icon component.
 */
const TreeIcon: React.FC<{ integrity: number }> = React.memo(({ integrity }) => {
  // Dynamic color mapping based on AI confidence score.
  const colorClass = useMemo(() => {
    if (integrity > 95) return "text-green-500 shadow-green-500/50";
    if (integrity > 80) return "text-lime-400 shadow-lime-400/50";
    return "text-yellow-400 shadow-yellow-400/50";
  }, [integrity]);

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      className={`h-16 w-16 transition-all duration-500 ease-in-out transform hover:scale-110 ${colorClass}`}
      fill="none"
      viewBox="0 0 24 24"
      stroke="currentColor"
      strokeWidth={1.2}
      style={{ filter: `drop-shadow(0 0 8px var(--tw-shadow-color))` }}
    >
      <path strokeLinecap="round" strokeLinejoin="round" d="M12 1v16m-4-4h8m-4 4v-4m0-12v4m0 0l4-4m-4 4l-4-4" />
      <path strokeLinecap="round" strokeLinejoin="round" d="M12 18c3.866 0 7-3.134 7-7s-3.134-7-7-7-7 3.134-7 7 3.134 7 7 7z" />
    </svg>
  );
});
TreeIcon.displayName = 'TreeIcon';

/**
 * @function ProgressGauge
 * @description Renders the sophisticated, multi-layered progress bar indicating proximity to the next ecological milestone.
 * @param {number} progress - Percentage completion.
 * @returns {JSX.Element} The progress visualization component.
 */
const ProgressGauge: React.FC<{ progress: number }> = React.memo(({ progress }) => {
  const safeProgress = Math.min(100, Math.max(0, progress));

  return (
    <div className="w-full mt-8">
      <div className="bg-gray-800 rounded-full h-3 shadow-inner border border-gray-700">
        <div
          className="h-3 rounded-full transition-all duration-1000 ease-out bg-gradient-to-r from-cyan-400 via-green-500 to-emerald-600 shadow-lg shadow-green-500/40"
          style={{ width: `${safeProgress}%` }}
          role="progressbar"
          aria-valuenow={safeProgress}
          aria-valuemin={0}
          aria-valuemax={100}
        ></div>
      </div>
      <p className="text-xs text-gray-400 mt-2 text-right font-mono">
        {safeProgress.toFixed(2)}% to Next Tier ({Math.ceil(100 - safeProgress)}% remaining)
      </p>
    </div>
  );
});
ProgressGauge.displayName = 'ProgressGauge';


